import React, { useState } from "react";
import { Donut } from "react-dial-knob";

// You can try Basic, White, Silver or HighContrast skins

export default function KnobDemo () {
  const [value, setValue] = React.useState(5)
  return <Donut
        diameter={200}
        min={0}
        max={20}
        step={1}
        value={value}
        theme={{
            donutColor: 'lightcoral'
        }}
        style={{
          position: 'relative',
          margin: '100px auto',
          width: '200px'
        }}
        onValueChange={setValue}
        ariaLabelledBy={'my-label'}
        spaceMaxFromZero={false}
    >
        <label id={'my-label'} style={{
          textAlign: 'center',
          width: '200px',
          display: 'block',
          padding: '10px 0'
        }}>My Label</label>
    </Donut>
}
